public class ProductOfNumbers {
    List<Integer> lst;
    Map<Integer, Integer> map;
    public ProductOfNumbers() {
        lst = new ArrayList<>();
        map = new HashMap<>();
    }

    public void add(int num) {
        lst.add(num);
        map = new HashMap<>();
    }

    public int getProduct(int k) {
        if (map.containsKey(k)) {
            return map.get(k);
        }
        int len = lst.size();
        int index = len - 1;
        int ans = 1;
        while (len - index <= k) {
            ans *= lst.get(index);
            index--;
        }
        map.put(k, ans);
        return ans;
    }

    public static void main(String[] args) {
        ProductOfNumbers ps = new ProductOfNumbers();
        ps.add(3);
        ps.add(0);
        ps.add(2);
        ps.add(5);
        ps.add(4);
        int ans1 = ps.getProduct(2);
        System.out.println(ans1);
        int ans2 = ps.getProduct(3);
        System.out.println(ans2);
        int ans3 = ps.getProduct(4);
        System.out.println(ans3);
        ps.add(8);
        int ans4 = ps.getProduct(2);
        System.out.println(ans4);
    }
}
